const ByeSell = () => {
  return (
    <div
      style={{
        height: "100vh",
        width: "100%",
        background: "gray",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
      }}
    >
      <div
        style={{
          height: "75%",
          width: "90%",
          background: "white",
          display: "flex",
        }}
      >
        <div
          style={{
            flex: 5,
            display: "flex",
            flexDirection: "column",
            alignItems: "center",
            justifyContent: "center",
          }}
        >
          <div style={{ flex: 2 }}>Coin Name</div>
          <div style={{ flex: 2 }}>Buying Amount</div>
          <div style={{ flex: 2 }}>Selling Amount</div>
          <div style={{ flex: 2 }}>Grid Amount</div>
        </div>
        <div style={{ flex: 5 }}>div_2</div>
      </div>
    </div>
  );
};

export default ByeSell;
